ipd_access_criteria:
The conditions under which members of the public will be granted access to datasets are:
The data will be used/examined in a not-for-profit manner;
The data will not be used in an attempt to identify a participant or group of participants;
The user does not work for a private insurance company;
The data will not be used in support of any kind of private insurance policy or health penalties;
The data will be used/examined for the advancement of science/teaching while respecting participant/patient privacy and rights;
The user will state why they wish to access the data.
The appropriate CNIL approval has been obtained by the user.

plan_to_share_ipd_description:
Clinical studies sponsored by Boehringer Ingelheim, phases I to IV, interventional and non-interventional, are in scope for sharing of the raw clinical study data and clinical study documents, except for the following exclusions:
studies in products where Boehringer Ingelheim is not the license holder;
studies regarding pharmaceutical formulations and associated analytical methods, and studies pertinent to pharmacokinetics using human biomaterials;
studies conducted in a single center or targeting rare diseases (because of limitations with anonymization).
For more details refer to: http://trials.boehringer-ingelheim.com/

Four data sources will be recorded for each patient who consents to participate in the study:
Electronic medical record (EMR);
Results of testing from the foam and polyester nasal swab samples;
Results of any blood testing performed on the blood samples;
Responses to a set of standard questions posed to each participant.
